import { CSSProperties, useState } from "react";
import styles from '../Component/HomeHeader.module.css'
import type { MenuProps } from 'antd';
import { Button, Menu } from 'antd';
import {
    AppstoreOutlined,
    ContainerOutlined,
    DesktopOutlined,
    MailOutlined,
    MenuFoldOutlined,
    MenuUnfoldOutlined,
    PieChartOutlined,
  } from '@ant-design/icons';
const HomeHeader = (collapsed, setCollapsed) => {

  const toggleCollapsed = () => {
    setCollapsed(!collapsed);
  };
 return (
    <>
    <div className={styles.headerBox}>
      <Button type="primary" onClick={toggleCollapsed} className={styles.menuButton}>
        {collapsed ? <MenuUnfoldOutlined /> : <MenuFoldOutlined />}
      </Button>
    </div>
    </>
 )
}

export default HomeHeader;
